#   requested cycle_time. The default is False.
initial_WHITE: 0.0
#   Sets the initial LED color. Each value should be between 0.0 and
#   1.0. The default for each color is 0.




# fans
# hotend cooling fan
[heater_fan hotend_fan]
# connected to fan0
pin: FAN0
max_power: 1.0
hardware_pwm: false
kick_start_time: 0.500
heater: extruder
heater_temp: 50.0
fan_speed: 1.00
tachometer_pin: ^PG9
tachometer_ppr: 2
# tachometer_poll_interval: 0.00075
tachometer_poll_interval: 0.0005
# 0.00053571428

[multi_pin part_cooling]
pins: FAN1


# Nevermore Micro
[heater_fan rebreatherXL]
# connected to green LED on s6
pin: FAN2
heater: heater_bed
heater_temp: 90.0
fan_speed: 1.0

# print cooling fan
[fan]
# connected to fan1
pin: multi_pin:part_cooling
max_power: 1.0
kick_start_time: 0.500

# backpack cooling fan  
[controller_fan electronics_fan_1]
# connected to fan3
pin: FAN3
max_power: 0.3
kick_start_time: 0.500
idle_timeout: 60
heater: heater_bed
stepper: stepper_x, stepper_x1, stepper_y, stepper_y1, stepper_z, stepper_z1, stepper_z2

[controller_fan electronics_fan_2]
pin: FAN4
max_power: 0.3
kick_start_time: 0.500
idle_timeout: 60
heater: heater_bed
stepper: stepper_x, stepper_x1, stepper_y, stepper_y1, stepper_z, stepper_z1, stepper_z2

[bed_mesh]
speed: 450
horizontal_move_z: 2
mesh_min: 20, 25
mesh_max: 150, 155
zero_reference_position: 90,90
probe_count: 50, 50
fade_start: 0.5
fade_end: 10
mesh_pps: 0
#algorithm: bicubic
#bicubic_tension: 0.2


[z_tilt]
# 3 z motors
z_positions: 
    -74.0, -18.0    # front left
    100.0,  217.0    # rear
    226.0, -18.0    # front right
points:
  111, 160        # Rear
  180, 13         # Front Right
  40, 13          # Front Left
speed: 300
horizontal_move_z: 8.0
retries: 4
retry_tolerance: 0.01

[idle_timeout]
timeout: 6000


